introduceable = true;                // \u662f\u5426\u5f00\u542f\u63a8\u8350\r\n  IntroduceData public introduceData;              // \u63a8\u8350\u76f8\u5173\u6570\u636e\r\n  \r\n  modifier noSelf(address _addr) {\r\n    require(_addr != address(0));\r\n    require(msg.sender != _addr);\r\n    _;\r\n  }\r\n\r\n  constructor(address _introduceData) public {\r\n    require(_introduceData != address(0), "Introduce data needed.");\r\n    introduceData = IntroduceData(_introduceData);\r\n  }\r\n\r\n  /// @dev \u8bbe\u7f6e\u662f\u5426\u5141\u8bb8\u63a8\u8350\u529f\u80fd\r\n  function setIntroduceable(bool _introduceable) public onlyOwner {\r\n    introduceable = _introduceable;\r\n  }\r\n\r\n  /// @dev \u8bbe\u7f6e\u63a8\u8350\u76f8\u5173\u6570\u636e\r\n  function setIntroduceData(address _introduceData) public {\r\n    require(_introduceData != address(0), "Introduce data needed.");\r\n    introduceData = IntroduceData(_introduceData);\r\n  }\r\n\r\n  /// @dev \u751f\u6210\u9080\u8bf7\u7801\r\n  function createInviteCode() public {\r\n    require(introduceable, "introduce turned off.");\r\n    // \u53ea\u6709\u5408\u7ea6\u521b\u5efa\u8005\u624d\u53ef\u4ee5\u7533\u8bf7\u9080\u8bf7\u7801\r\n    require(msg.sender == owner, "only owner can create invite code.");\r\n\r\n    string storage inviteCode = myInviteCodes[msg.sender];\r\n    if(bytes(inviteCode).length == 0) {\r\n      Random random = new Random();\r\n      string memory ic = random.randomWord(6);\r\n      inviteCodes[ic] = msg.sender;\r\n      myInviteCodes[msg.sender] = ic;\r\n    }\r\n  }\r\n  \r\n  /// @dev \u6211\u7684\u9080\u8bf7\u7801\r\n  function myInviteCode() public view returns(string) {\r\n    return myInviteCodes[msg.sender];\r\n  }\r\n  \r\n  /// @dev \u9080\u8bf7\u7801\u5bf9\u5e94\u7684\u94b1\u5305\u5730\u5740\r\n  function inviteCodeForAddress(string _inviteCode) public view returns(address) {\r\n    return inviteCodes[_inviteCode];\r\n  }\r\n  \r\n  /// @dev \u901a\u8fc7\u586b\u5199\u9080\u8bf7\u7801\uff0c\u8bbe\u7f6e\u63a8\u8350\u4eba\r\n  function setInviteCode(string _inviteCode) public {\r\n    address introducer = introduceData.introducers(msg.sender);\r\n    require(introducer == address(0), "Inviters can be set up without invitation.");\r\n    address invitor = inviteCodes[_inviteCode];\r\n    require(invitor != address(0), "Invitation code must exist.");\r\n    setIntroducer(invitor);\r\n  }\r\n\r\n  /// @dev \u76f4\u63a5\u8bbe\u7f6e\u63a8\u8350\u4eba\r\n  function setIntroducer(address _introducer) noSelf(_introducer) internal {\r\n    require(introduceable, "introduce turned off.");\r\n    // \u5f53\u524d\u7528\u6237\u7684\u63a8\u8350\u4eba\r\n    address introducer = introduceData.introducers(msg.sender);\r\n    if(introducer != address(0)) {\r\n      return;\r\n    }\r\n    // \u5f53\u524d\u51c6\u5907\u8bbe\u7f6e\u7684\u63a8\u8350\u4eba\u7684\u63a8\u8350\u4eba\r\n    address aheadIntroducer = introduceData.introducers(_introducer);\r\n    // \u4e0d\u53ef\u4ee5A\u63a8\u8350\u4e86B\uff0c\u53cd\u8fc7\u6765B\u53c8\u63a8\u8350\u4e86A\r\n    if(aheadIntroducer == msg.sender) {\r\n      return;\r\n    }\r\n    introduceData.setIntroducer(msg.sender, _introducer);\r\n    // \u5c06\u5f53\u524d\u7528\u6237\u52a0\u5165\u6211\u7684\u56e2\u961f\r\n    introduceData.addTeam(msg.sender, _introducer);\r\n\r\n    // \u8bbe\u7f6e\u5b8c\u9080\u8bf7\u4eba\u4e4b\u540e,\u81ea\u52a8\u751f\u6210\u5f53\u524d\u7528\u6237\u7684\u9080\u8bf7\u7801\r\n    Random random = new Random();\r\n    string memory ic = random.randomWord(6);\r\n    inviteCodes[ic] = msg.sender;\r\n    myInviteCodes[msg.sender] = ic;\r\n  }\r\n\r\n  /// @dev \u6211\u7684\u56e2\u961f\r\n  function myTeam() public view returns(address[]) {\r\n    address[] memory team = introduceData.myTeam(msg.sender);\r\n    return team;\r\n  }\r\n  \r\n  /// @dev \u6211\u7684\u63a8\u8350\u4eba\r\n  function myIntroducer() public view returns(address) {\r\n    return introduceData.introducers(msg.sender);\r\n  }\r\n\r\n  function myIntroduceInfo() public view returns(string, address, address[]) {\r\n    return (myInviteCodes[msg.sender], myIntroducer(), myTeam());\r\n  }\r\n}',sourcePath:"D:/workspace/cupcake-dapp/contracts/Introduce.sol",ast:{absolutePath:"/D/workspace/cupcake-dapp/contracts/Introduce.sol",exportedSymbols:{Introduce:[3188]},id:3189,nodeType:"SourceUnit",nodes:[{id:2831,literals:["solidity","^","0.4",".25"],nodeType:"PragmaDirective",src:"0:24:6"},{absolutePath:"zeppelin-solidity/contracts/ownership/Ownable.sol",file:"zeppelin-solidity/contracts/ownership/Ownable.sol",id:2832,nodeType:"ImportDirective",scope:3189,sourceUnit:11656,src:"26:59:6",symbolAliases:[],unitAlias:""},{absolutePath:"/D/workspace/cupcake-dapp/contracts/util/Random.sol",file:"./util/Random.sol",id:2833,nodeType:"ImportDirective",scope:3189,sourceUnit:11134,src:"87:27:6",symbolAliases:[],unitAlias:""},{absolutePath:"/D/workspace/cupcake-dapp/contracts/data/IntroduceData.sol",file:"./data/IntroduceData.sol",id:2834,nodeType:"ImportDirective",scope:3189,sourceUnit:9559,src:"116:34:6",symbolAliases:[],unitAlias:""},{baseContracts:[{arguments:null,baseName:{contractScope:null,id:2835,name:"Ownable",nodeType:"UserDefinedTypeName",referencedDeclaration:11655,src:"176:7:6",typeDescriptions:{typeIdentifier:"t_contract$_Ownable_$11655",typeString:"contract Ownable"}},id:2836,nodeType:"InheritanceSpecifier",src:"176:7:6"}],contractDependencies:[11133,11655],contractKind:"contract",documentation:null,fullyImplemented:!0,id:3188,linearizedBaseContracts:[3188,11655],name:"Introduce",nodeType:"ContractDefinition",nodes:[{constant:!1,id:2840,name:"inviteCodes",nodeType:"VariableDeclaration",scope:3188,src:"193:38:6",stateVariable:!0,storageLocation:"default",typeDescriptions:{typeIdentifier:"t_mapping$_t_string_memory_$_t_address_$",typeString:"mapping(string => address)"},typeName:{id:2839,keyType:{id:2837,name:"string",nodeType:"ElementaryTypeName",src:"201:6:6",typeDescriptions:{typeIdentifier:"t_string_s